query ArtworkQuery(
  $artworkID: String!
) {
  artwork(id: $artworkID) {
    ...Artwork_artwork
    __id
  }
}

fragment Artwork_artwork on Artwork {
  title
  ...ArtworkTombstone_artwork
  __id
}

fragment ArtworkTombstone_artwork on Artwork {
  title
  medium
  date
  cultural_maker
  artists {
    __id
    name
    href
  }
  dimensions {
    in
    cm
  }
  edition_of
  attribution_class {
    short_description
  }
  __id
}
